// MerchPrint.js
// Detailed page for merchandise and apparel printing services.

import React from 'react';
import { Link } from 'react-router-dom';

const MerchPrint = () => {
  return (
    <div className="service-page">
      <h1>Печать на одежде и мерче</h1>
      <img
        src={process.env.PUBLIC_URL + '/img/merch.png'}
        alt="Печать на одежде и мерче"
        className="service-page__image"
      />
      <p>
        Нанесём принты, логотипы и надписи на футболки, худи и другие
        изделия. Используем качественные текстильные изделия и стойкие
        красители, чтобы изображение сохранялось после многих стирок.
      </p>
      <p><strong>Стоимость:</strong> от 600 ₽ за изделие.</p>
      <p><strong>Срок исполнения:</strong> от 1 дня.</p>
      <Link to="/services" className="btn btn-primary">
        Вернуться к услугам
      </Link>
    </div>
  );
};

export default MerchPrint;
